import React, { Fragment } from 'react';
import { Link, Route, Switch } from 'react-router-dom/Route';
import { AppBar, Toolbar, Typography } from '@material-ui/core';
import { Tabs, Tab, Button } from '@material-ui/core';
import Home from './../SS/Home';
import Sarees from './../SS/Sarees';

function LinkTab(props) {
  return <Tab component="a" onClick={event => event.preventDefault()} {...props} />;
}

const Header = (props) => {
  const value = props.value;
  const handler = props.handleChange;
  return (
    <Fragment>
    <AppBar position="static">
    <Toolbar>
          <Typography variant="h6" color="inherit" style={{fontFamily: "'Satisfy', Lato", flex: 1}}>
            Shree Silks
          </Typography>
          <Button color="inherit">Login</Button>
      </Toolbar>
    </AppBar>
    <Tabs centered value={value} onChange={handler} indicatorColor="primary">
      <Tab label="Home" component={Link} to="/"/>
      <Tab label="Sarees" component={Link} to="/sarees"/>
      <Tab label="Contact us" component={Link} to="/contact-us" />
    </Tabs>
    <Switch>
      <Route path="/" render={() => <Home/>} />
      <Route path="/sarees" render={() => <Sarees/>} />
      <Route path="/contact-us" render={() => <div>Contact us</div>} />
    </Switch>
    </Fragment>
  );
}

export default Header;
